import "./Navbar.css";

function Navbar() {
  return (
    <div className="Navbar">
      <button className="NavBarButton">button</button>
      <button className="NavBarButton">button</button>
      <button className="NavBarButton">button</button>
      <button className="NavBarCart"></button>
    </div>
  );
}

export default Navbar;
